Mongo db Write order<p>This post will be quite long, if you are a mongo god and you want to help me anyway, I thank you from the bottom of my heart. I try to be as exaustive as possible, with all the data I collected.</p>

<p>I'm experiencing some strange behaviour in my MongoDD database, and I'm questionning mongodb's write order.</p>

<p>I have logged bugs, that only happen at the time of the execution, that made me think that we have a timming problem here, but the requesting is so slow, that I don't understand how It can happen in suck conditions</p>

<p>Starting points:</p>

<ul>
<li>All ObjectIds are auto-given by mongo, I never set them on my side</li>
<li>This objectId is indexed (obviously) and unique</li>
<li>I use the timestamp in those requests ids to query the DB, using this request:</li>
</ul>

<pre><code>    db.getCollection('eventStore').find({
      '_id': {
        '$gt': ObjectId("5d285c784460c502cc66ff9b"),
        '$lte': ObjectId("5d285cf7856cda0266215c77")
      }
    })
</code></pre>

<ul>
<li>The results of this request are then streamed using the basic Node.js client possibilies:</li>
</ul>

<pre><code>    collection.find({
        '_id': {
          ...(lower ? { '$gt': lower } : {}),
          '$lte': higher
        }
      }).sort({ _id: 1 }).stream({
        transform: (element) =&gt; {
          logger.info(`Exiting Get events by range::${JSON.stringify(lower)}::${JSON.stringify(higher)}`)
          logger.info(`Parse event::${JSON.stringify(element)}}`)
          return // PARSED EVENT
        }
      })
</code></pre>

<ul>
<li>At this point, I know that the <code>.sort({ _id: 1 })</code> is probably useless, but I keep it here anyway, just in case.</li>
<li>The requesting procedure is quite slow: I query the upperbound in order to have the eventStore's offset, then the view's offset, then I query the store in order to have all events between these boundaries. </li>
<li>The sample of mongo's data:</li>
</ul>

<pre><code>    /* 1 */
    {
        "_id" : ObjectId("5d285cf77f6482027108c15c"),
        "events" : [ 
            // Some events
        ]
    }

    /* 2 */
    {
        "_id" : ObjectId("5d285cf77f6482027108c15d"),
        "events" : [
            // Some events
        ]
    }

    /* 3 */
    {
        "_id" : ObjectId("5d285cf7856cda0266215c77"),
        "events" : [ 
            // Some events
        ]
    }
</code></pre>

<p>Expected Mongo Behaviour:</p>

<ul>
<li>Mongo is self assigning the Ids, so I expect that when the ID
ObjectId("5d285cf7856cda0266215c77") is stored in base, all the IDs with a older timestamp are stored safe in the base already. ==> No backpedaling</li>
<li>The timestamp encoded in the ObjectId (when it's self given by mongo) is the one when it's written and persisted in the DB, not the one when it's received by Mongo. </li>
</ul>

<p>Actual behaviour (as logged in the logger's function):</p>

<ul>
<li>Only the first and the last _ids have been seen in the logger's function</li>
</ul>

<pre><code>    {"message":"Exiting Get events by range::\"5d285c784460c502cc66ff9b\"::\"5d285cf7856cda0266215c77\"","level":"info","timestamp":"2019-07-12 10:12:07"} 
    {"message":"Parse event::{\"_id\":\"5d285cf77f6482027108c15c\",\"events\":[ // Data ]}}","level":"info","timestamp":"2019-07-12 10:12:07"} 
    {"message":"Exiting Get events by range::\"5d285c784460c502cc66ff9b\"::\"5d285cf7856cda0266215c77\"","level":"info","timestamp":"2019-07-12 10:12:07"} 
    {"message":"Parse event::{\"_id\":\"5d285cf7856cda0266215c77\",\"events\":[ // Data ]}}","level":"info","timestamp":"2019-07-12 10:12:07"}

</code></pre>

<ul>
<li>As it seems:

<ol>
<li>Or the event _id: ObjectId("5d285cf77f6482027108c15d") was not in base at the time of the call, but the older _id: ObjectId("5d285cf7856cda0266215c77") was.</li>
<li>Or my request or stream is invalid at the time of the call (but now, returns the correct answer)</li>
<li>Something else ?</li>
</ol></li>
</ul>

