Creating a generic delegate using reflection<p>I'm familiar with constructing and calling generic methods through reflection, but for some reason, constructing a generic delegate through reflection is tying my brain in knots!</p>

<p>Perhaps it's because the delegate in particular is not the most simple. This isn't specifically a MongoDb question, but in my case what I'm trying to do is register a class map as a root class where the type is in a type variable because I've only just found it out (not fed in generically).
Ultimately, the method I need to call looks like this:</p>

<pre><code>    BsonClassMap.RegisterClassMap&lt;T&gt;(Action&lt;BsonClassMap&lt;T&gt;&gt; classMapInitializer)
</code></pre>

<p>So in cases where the class I'm mapping isn't a root class, I don't need to pass the delegate, so the code is pretty straightforward:</p>

<pre><code>    MethodInfo method = typeof(BsonClassMap).GetMethod("RegisterClassMap");
    MethodInfo genericMethod = method.MakeGenericMethod(entityType);
    genericMethod.Invoke(null, null);
</code></pre>

<p>I've checked out questions such as <a href="https://stackoverflow.com/questions/12131301/how-can-i-dynamically-create-an-actiont-at-runtime">How can I dynamically create an Action&lt;T&gt; at runtime?</a> and I understand what's going on there, but for some reason the nested generic in my case is throwing me off and I can't wrap my head around it.</p>

<p>I am trying to construct and invoke the equivalent of this:</p>

<pre><code>    BsonClassMap.RegisterClassMap&lt;T&gt;(cm =&gt;
    {
        cm.AutoMap();
        cm.SetIsRootClass(true);
    });
</code></pre>

<p>Could someone please explain a bit more about generic delegate creation, particularly where the type in the action has a generic type argument of it's own? An example similar to what I'm trying to do would be great!</p>

