Query by data already in the object<p>I'm writing a query that gets data from "coll2" based on data that is inside "coll1". </p>

<p>Coll1 has the following data structure:</p>

<pre><code>{
  "_id": "asdf",
  "name": "John",
  "bags": [
    {
       "type": "typ1",
       "size": "siz1"
    },
    {
       "type": "typ2",
       "size": "siz2"
    }
  ]
}
</code></pre>

<p>Coll2 has the following data structure:</p>

<pre><code>{
  _id: "qwer",
  coll1Name: "John",
  types: ["typ1", "typ3"],
  sizes: ["siz1", "siz4"]
}
{
  _id: "zxcv",
  coll1Name: "John",
  types: ["typ2", "typ3"],
  sizes: ["siz1", "siz2"]
}
{
  _id: "fghj",
  coll1Name: "John",
  types: ["typ2", "typ3"],
  sizes: ["siz1", "siz4"]
}
</code></pre>

<p>I want to get all the documents in coll2 that have the same Type+Size combo as in coll1 using the <code>$lookup</code> stage of the aggregation pipeline. I understand that this can be achieved by using the <code>$lookup pipeline</code> and <code>$expr</code> but I cant seem to figure out how to dynamically make a query to pass into the <code>$match</code> stage. </p>

